import logo from './logo.svg';
import './App.css';
import {Route,Routes} from 'react-router-dom';
import { BrowserRouter,Link } from 'react-router-dom';
import HomeComponent from './components/HomeComponent';
import Register from './components/Register';
import Login from './components/Login';
import CourseGrades from './components/individual-course-student/course-grades';

export default function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <nav id="navbar">
          <Link to="/">Home</Link>{" ~ "}
          <Link to="/login">Login</Link>{" ~ "}
          <Link to="/register">Register</Link>
        </nav>
        <Routes>
          <Route path='' element={<HomeComponent />} />
          <Route path='/register' element={<Register/>}/>
          <Route path='/login' element={<Login/>}/>
          <Route path='/course-grades' element={<CourseGrades/>}/>
          <Route path='/course-home' element={<CourseGrades/>}/>
          <Route path='/course-' element={<CourseGrades/>}/>
          <Route path='/grades' element={<CourseGrades/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
